import React,{Component} from 'react';
import {Link} from 'react-router-dom';

class Home extends Component{
    render(){
        return(
            <section className="mandal-section">
                <div>함께, 계획을 세워요!</div>
                <Link to="/write"><button className="btn write">만다라트 만들기</button></Link>
            </section>
        )
    }
}

export default Home;
